PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?person ?dateOfDeath ?archivesInstitution WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P21 wd:Q6581072 ; wdt:P570 ?dateOfDeath .
  FILTER ( ?dateOfDeath < "1948-01-01T00:00:00Z" ^^ xsd:dateTime ) {
    ?person wdt:P19 ?place .
  } UNION {
    ?person wdt:P20 ?place .
  }
  OPTIONAL {
    ?place wdt:P131 * wd:Q3240 .
    BIND( true AS ?inDept )
  }
  FILTER ( ?place = wd:Q3240 || ?inDept = true ) OPTIONAL {
    ?person wdt:P485 ?archivesInstitution .
  }
}
ORDER BY ?dateOfDeath
LIMIT 1000

PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?person ?personLabel ( MAX( xsd:decimal ( ?usdAmount ) ) AS ?maxUsd ) ( SAMPLE( ?amount ) AS ?sampleAmount ) ( SAMPLE( ?unit ) AS ?sampleUnit ) ( SAMPLE( ?unitLabel ) AS ?sampleUnitLabel ) WHERE {
  ?person wdt:P31 wd:Q5 .
  ?person wdt:P21 wd:Q6581072 .
  ?person p:P2218 ?stmt .
  ?stmt psv:P2218 ?valNode .
  ?valNode wikibase:quantityAmount ?amount .
  OPTIONAL {
    ?valNode wikibase:quantityUnit ?unit
  }
  .
  OPTIONAL {
    ?stmt pq:P2442 ?convValNode .
    ?convValNode wikibase:quantityAmount ?convValue .
    ?convValNode wikibase:quantityUnit ?convUnit .
  }
  OPTIONAL {
    ?person wdt:P2218 ?wdtAmount
  }
  BIND( IF( BOUND( ?unit ) && ?unit = wd:Q4917 , xsd:decimal ( ?amount ) , IF( BOUND( ?convUnit ) && ?convUnit = wd:Q4917 , xsd:decimal ( ?convValue ) , COALESCE ( xsd:decimal ( ?wdtAmount ) , xsd:decimal ( ?amount ) ) ) ) AS ?usdAmount ) OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?unit rdfs:label ?unitLabel FILTER ( LANG( ?unitLabel ) = "en" )
  }
}
GROUP BY ?person ?personLabel
HAVING ( MAX( xsd:decimal ( ?usdAmount ) ) >= 1000000000 )
ORDER BY DESC ( ?maxUsd )

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?numPartners ( COALESCE ( ?femaleCount , 0 ) AS ?femaleCount0 ) ( COALESCE ( ?maleCount , 0 ) AS ?maleCount0 ) WHERE {
  {
    SELECT DISTINCT ?numPartners WHERE {
      {
        SELECT ?artist ( COUNT( DISTINCT ?partner ) AS ?numPartners ) WHERE {
          ?artist wdt:P106 wd:Q108289408 .
          ?artist wdt:P21 ?sex .
          FILTER ( ?sex IN ( wd:Q6581072 , wd:Q6581097 ) ) OPTIONAL {
            ?artist wdt:P451 ?partner .
          }
        }
        GROUP BY ?artist ?sex
      }
    }
  }
  OPTIONAL {
    SELECT ?numPartners ( COUNT( DISTINCT ?artist ) AS ?femaleCount ) WHERE {
      {
        SELECT ?artist ( COUNT( DISTINCT ?partner ) AS ?numPartners ) WHERE {
          ?artist wdt:P106 wd:Q108289408 ; wdt:P21 wd:Q6581072 .
          OPTIONAL {
            ?artist wdt:P451 ?partner .
          }
        }
        GROUP BY ?artist
      }
    }
    GROUP BY ?numPartners
  }
  OPTIONAL {
    SELECT ?numPartners ( COUNT( DISTINCT ?artist ) AS ?maleCount ) WHERE {
      {
        SELECT ?artist ( COUNT( DISTINCT ?partner ) AS ?numPartners ) WHERE {
          ?artist wdt:P106 wd:Q108289408 ; wdt:P21 wd:Q6581097 .
          OPTIONAL {
            ?artist wdt:P451 ?partner .
          }
        }
        GROUP BY ?artist
      }
    }
    GROUP BY ?numPartners
  }
}
ORDER BY ?numPartners

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?version ?date WHERE {
  wd:Q83 p:P348 ?ps .
  ?ps ps:P348 ?version .
  OPTIONAL {
    ?ps pq:P577 ?date
  }
}
ORDER BY ?date

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?lighthouse ?lighthouseLabelEN ?lighthouseLabelSV ?coord ?color ?colorLabel WHERE {
  ?lighthouse wdt:P31 wd:Q39715 ; wdt:P131 wd:Q504676 .
  {
    ?lighthouse wdt:P206 wd:Q545 .
  } UNION {
    ?lighthouse wdt:P706 ?feature .
    ?feature wdt:P206 wd:Q545 .
  }
  OPTIONAL {
    ?lighthouse wdt:P462 ?color .
    OPTIONAL {
      ?color rdfs:label ?colorLabel .
      FILTER ( LANG( ?colorLabel ) = "en" )
    }
  }
  OPTIONAL {
    ?lighthouse rdfs:label ?lighthouseLabelEN .
    FILTER ( LANG( ?lighthouseLabelEN ) = "en" )
  }
  OPTIONAL {
    ?lighthouse rdfs:label ?lighthouseLabelSV .
    FILTER ( LANG( ?lighthouseLabelSV ) = "sv" )
  }
  OPTIONAL {
    ?lighthouse wdt:P625 ?coord .
  }
}
ORDER BY ?lighthouse

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?item ( COALESCE ( ?labelEn , ?labelDe , STR( ?item ) ) AS ?itemLabel ) ?image ?start ?end ( COALESCE ( ?end , NOW () ) AS ?endOrNow ) WHERE {
  ?item wdt:P2868 wd:Q151345 .
  OPTIONAL {
    ?item wdt:P18 ?image .
  }
  OPTIONAL {
    ?item p:P2868 ?stmt .
    ?stmt ps:P2868 wd:Q151345 .
    OPTIONAL {
      ?stmt pq:P580 ?start .
    }
    OPTIONAL {
      ?stmt pq:P582 ?end .
    }
  }
  OPTIONAL {
    ?item rdfs:label ?labelEn FILTER ( LANG( ?labelEn ) = "en" )
  }
  OPTIONAL {
    ?item rdfs:label ?labelDe FILTER ( LANG( ?labelDe ) = "de" )
  }
}
ORDER BY ?start

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?event ?eventLabel ?tournament ?tournamentLabel WHERE {
  ?event wdt:P2094 wd:Q16893072 .
  ?event wdt:P361 ?tournament .
  ?tournament wdt:P361 + ?circuit .
  FILTER ( ?circuit IN ( wd:Q300008 , wd:Q3775082 ) ) .
  FILTER NOT EXISTS {
    ?event wdt:P1346 ?winner
  }
  .
  OPTIONAL {
    ?event rdfs:label ?eventLabel FILTER ( LANG( ?eventLabel ) = "en" )
  }
  OPTIONAL {
    ?tournament rdfs:label ?tournamentLabel FILTER ( LANG( ?tournamentLabel ) = "en" )
  }
}
ORDER BY ?tournament ?event

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?institution ( COUNT( DISTINCT ?thesis ) AS ?count ) ?instLabel WHERE {
  ?thesis wdt:P4101 ?institution .
  ?thesis wdt:P31 ?type .
  VALUES ?type {
    wd:Q1266946 wd:Q187685
  }
  OPTIONAL {
    ?institution rdfs:label ?instLabel FILTER ( LANG( ?instLabel ) = "en" )
  }
}
GROUP BY ?institution ?instLabel
ORDER BY DESC ( ?count )
LIMIT 10

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?person ?dateOfDeath ?fsid ?father ?fatherLabel WHERE {
  ?person wdt:P27 wd:Q16 ; wdt:P570 ?dateOfDeath ; wdt:P2889 ?fsid ; wdt:P22 ?father .
  FILTER NOT EXISTS {
    ?father wdt:P2889 ?fatherFSID
  }
  OPTIONAL {
