PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?work ?workLabel ?instance ?instanceLabel WHERE {
  VALUES ?allowedInstance {
    wd:Q571 wd:Q3331189 wd:Q7725634 wd:Q47461344 wd:Q8261 wd:Q1347298 wd:Q21112633
  }
  ?work wdt:P50 wd:Q35610 ; wdt:P31 ?instance .
  FILTER ( ?instance IN ( wd:Q571 , wd:Q3331189 , wd:Q7725634 , wd:Q47461344 , wd:Q8261 , wd:Q1347298 , wd:Q21112633 ) ) OPTIONAL {
    ?work rdfs:label ?workLabel FILTER ( LANG( ?workLabel ) = "en" )
  }
  OPTIONAL {
    ?instance rdfs:label ?instanceLabel FILTER ( LANG( ?instanceLabel ) = "en" )
