PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?item ?itemLabel ?inception ?commemorates ?commemoratesLabel ?image ?coord ?heritageDesignation ?heritageDesignationLabel WHERE {
  VALUES ?city {
    wd:Q1757
  }
  {
    ?item wdt:P131 ?city .
  } UNION {
    ?item wdt:P276 ?city .
  }
  {
    ?item wdt:P1435 ?heritageDesignation .
  } UNION {
    ?item wdt:P31 / wdt:P279 * wd:Q210272 .
  }
  OPTIONAL {
    ?item wdt:P571 ?inception .
  }
  OPTIONAL {
    ?item wdt:P547 ?commemorates .
  }
  OPTIONAL {
    ?item wdt:P18 ?image .
  }
  OPTIONAL {
    ?item wdt:P625 ?coord .
  }
  OPTIONAL {
    ?item rdfs:label ?itemLabel .
    FILTER ( LANG( ?itemLabel ) = "en" )
  }
  OPTIONAL {
    ?heritageDesignation rdfs:label ?heritageDesignationLabel .
    FILTER ( LANG( ?heritageDesignationLabel ) = "en" )
  }
  OPTIONAL {
    ?commemorates rdfs:label ?commemoratesLabel .
    FILTER ( LANG( ?commemoratesLabel ) = "en" )
  }
}
ORDER BY ?item

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?player ?playerLabel WHERE {
  ?player wdt:P31 wd:Q5 .
  ?player wdt:P106 ?occ .
  ?occ wdt:P279 * wd:Q10833314 .
  ?player wdt:P27 wd:Q31 .
  FILTER NOT EXISTS {
    ?player wdt:P27 ?otherCit .
    FILTER ( ?otherCit != wd:Q31 )
  }
  OPTIONAL {
    ?player rdfs:label ?playerLabel .
    FILTER ( LANG( ?playerLabel ) = "en" )
  }
}
ORDER BY ?playerLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?type ( COUNT( DISTINCT ?org ) AS ?count ) ?typeLabel WHERE {
  BIND( wd:Q107356467 AS ?balearic ) {
    ?org wdt:P131 + ?balearic .
  } UNION {
    ?org wdt:P159 ?hq .
    ?hq wdt:P131 + ?balearic .
  } UNION {
    ?org wdt:P276 ?loc .
    ?loc wdt:P131 + ?balearic .
  }
  ?org wdt:P31 ?type .
  ?type wdt:P279 * wd:Q43229 .
  OPTIONAL {
    ?type rdfs:label ?typeLabel .
    FILTER ( LANG( ?typeLabel ) = "en" )
  }
}
GROUP BY ?type ?typeLabel
ORDER BY DESC ( ?count )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?item ?itemLabel WHERE {
  ?item wdt:P279 * wd:Q87167 .
  FILTER ( ?item != wd:Q87167 ) OPTIONAL {
    ?item rdfs:label ?itemLabel .
    FILTER ( LANG( ?itemLabel ) = "en" )
  }
}
ORDER BY ?item

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?prop ?propLabel ?value ?valueLabel WHERE {
  wd:Q9696 ?prop ?value .
  FILTER ( STRSTARTS( STR( ?prop ) , "http://www.wikidata.org/prop/direct/" ) ) .
  OPTIONAL {
    ?prop rdfs:label ?propLabel .
    FILTER ( LANG( ?propLabel ) = "en" )
  }
  OPTIONAL {
    ?value rdfs:label ?valueLabel .
    FILTER ( LANG( ?valueLabel ) = "en" )
  }
}
ORDER BY ?prop ?value

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?legalCategory ?labelFr ?count WHERE {
  {
    SELECT ?legalCategory ( SAMPLE( ?labelFr_ ) AS ?labelFr ) ( COUNT( DISTINCT ?entity ) AS ?count ) WHERE {
      ?entity wdt:P17 wd:Q142 ; wdt:P1454 ?legalCategory .
      ?legalCategory rdfs:label ?labelFr_
      FILTER ( LANG( ?labelFr_ ) = "fr" ) .
    }
    GROUP BY ?legalCategory
    HAVING ( COUNT( DISTINCT ?entity ) > 499 )
  } UNION {
    SELECT ( ?otherIRI AS ?legalCategory ) ( "OTHER" AS ?labelFr ) ( SUM( ?cnt ) AS ?count ) WHERE {
      BIND( <urn:OTHER> AS ?otherIRI ) {
        SELECT ?cat ( COUNT( DISTINCT ?entity ) AS ?cnt ) WHERE {
          ?entity wdt:P17 wd:Q142 ; wdt:P1454 ?cat .
        }
        GROUP BY ?cat
        HAVING ( COUNT( DISTINCT ?entity ) <= 499 )
      }
    }
    GROUP BY ?otherIRI
  }
}
ORDER BY DESC ( ?count )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?periodical ?periodicalLabel WHERE {
  ?periodical wdt:P31 / wdt:P279 * wd:Q1002697 .
  ?periodical wdt:P407 wd:Q143 .
  OPTIONAL {
    ?periodical rdfs:label ?periodicalLabel .
    FILTER ( LANG( ?periodicalLabel ) = "en" )
  }
}
ORDER BY ?periodicalLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?city ?cityLabel ?coord ( MAX( ?popVal ) AS ?population ) WHERE {
  ?city wdt:P17 wd:Q159 ; wdt:P625 ?coord ; wdt:P1082 ?popVal ; wdt:P31 ?type .
  {
    ?type wdt:P279 * wd:Q515 .
  } UNION {
    ?type wdt:P279 * wd:Q3957 .
  }
  FILTER ( ?popVal > 100000 ) OPTIONAL {
    ?city rdfs:label ?cityLabel .
    FILTER ( LANG( ?cityLabel ) = "en" )
  }
}
GROUP BY ?city ?cityLabel ?coord
ORDER BY DESC ( ?population )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?chapter ?jpTitle ?volume ?seriesOrdinal ?pubDate ?placeOfPub ?placeOfPubLabel WHERE {
