  }
  OPTIONAL {
    ?chapter wdt:P478 ?volume
  }
  OPTIONAL {
    ?chapter wdt:P1545 ?seriesOrdinal
  }
  OPTIONAL {
    ?chapter wdt:P577 ?pubDate
  }
  OPTIONAL {
    ?chapter wdt:P291 ?placeOfPub .
    OPTIONAL {
      ?placeOfPub rdfs:label ?placeOfPubLabel FILTER ( LANG( ?placeOfPubLabel ) = "en" )
    }
  }
}
LIMIT 500

