    ?country wdt:P31 wd:Q3024240 .
  }
  FILTER NOT EXISTS {
    ?country wdt:P31 wd:Q28171280 .
  }
  FILTER NOT EXISTS {
    ?country wdt:P582 ?end .
  }
  OPTIONAL {
    ?country p:P36 ?capStmt .
    ?capStmt ps:P36 ?capital .
    OPTIONAL {
      ?capStmt pq:P459 ?capitalDetermination .
    }
  }
  OPTIONAL {
    ?country wdt:P38 ?currency .
  }
  OPTIONAL {
    ?country p:P1082 ?popStmt .
    ?popStmt ps:P1082 ?population .
    OPTIONAL {
      ?popStmt pq:P585 ?populationDate .
    }
  }
  OPTIONAL {
    ?country wdt:P41 ?flagImage .
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" )
  }
  OPTIONAL {
    ?capital rdfs:label ?capitalLabel FILTER ( LANG( ?capitalLabel ) = "en" )
  }
  OPTIONAL {
    ?capitalDetermination rdfs:label ?capitalDeterminationLabel FILTER ( LANG( ?capitalDeterminationLabel ) = "en" )
  }
  OPTIONAL {
    ?currency rdfs:label ?currencyLabel FILTER ( LANG( ?currencyLabel ) = "en" )
