PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?tournament ?country ?endTime ?location ?edition ?pointInTime ?surface WHERE {
  ?tournament wdt:P361 wd:Q23039138 .
  OPTIONAL {
    ?tournament wdt:P17 ?country .
  }
  OPTIONAL {
    ?tournament wdt:P582 ?endTime .
