PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?person ?personLabel ?gender ?genderLabel ?dob ?age WHERE {
  {
    SELECT ?person ?dob WHERE {
      ?person wdt:P31 wd:Q5 ; wdt:P106 wd:Q10833314 ; wdt:P569 ?dob .
      FILTER NOT EXISTS {
        ?person wdt:P570 ?dod .
      }
      BIND( YEAR( ?dob ) AS ?birthYear ) BIND( YEAR( NOW () ) AS ?nowYear ) FILTER ( ?birthYear > ( ?nowYear - 110 ) )
    }
    ORDER BY ASC ( ?dob )
    LIMIT 100
  }
  OPTIONAL {
    ?person wdt:P21 ?gender .
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?gender rdfs:label ?genderLabel FILTER ( LANG( ?genderLabel ) = "en" )
  }
  BIND( YEAR( NOW () ) AS ?nowYear ) BIND( MONTH( NOW () ) AS ?nowMonth ) BIND( DAY( NOW () ) AS ?nowDay ) BIND( YEAR( ?dob ) AS ?birthYear ) BIND( MONTH( ?dob ) AS ?birthMonth ) BIND( DAY( ?dob ) AS ?birthDay ) BIND( ( ?nowYear - ?birthYear ) - IF( ( ?nowMonth * 100 + ?nowDay ) < ( ?birthMonth * 100 + ?birthDay ) , 1 , 0 ) AS ?age )
}
ORDER BY DESC ( ?age )

