PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
SELECT ?award ?awardLabel ( COUNT( DISTINCT ?person ) AS ?total ) ( SUM( IF( ?relation = "before" , 1 , 0 ) ) AS ?before ) ( SUM( IF( ?relation = "after" , 1 , 0 ) ) AS ?after ) ( SUM( IF( ?relation = "same" , 1 , 0 ) ) AS ?same ) ( SUM( IF( ?relation = "unknown" , 1 , 0 ) ) AS ?unknown ) WHERE {
  {
    SELECT DISTINCT ?person ?award ?relation WHERE {
      ?person wdt:P166 wd:Q703205 .
      ?person p:P166 ?leibStmt .
      ?leibStmt ps:P166 wd:Q703205 .
      OPTIONAL {
        ?leibStmt pq:P585 ?leibDate .
      }
      ?person p:P166 ?awardStmt .
      ?awardStmt ps:P166 ?award .
      FILTER ( ?award != wd:Q703205 ) ?award wdt:P31 / wdt:P279 * ?class .
      VALUES ?class {
        wd:Q618779 wd:Q11448906 wd:Q15383322 wd:Q107471279 wd:Q378427 wd:Q107494520 wd:Q1966910 wd:Q1709894
      }
      OPTIONAL {
        ?awardStmt pq:P585 ?awardDate .
      }
      BIND( IF( ! BOUND( ?awardDate ) || ! BOUND( ?leibDate ) , "unknown" , IF( ?awardDate < ?leibDate , "before" , IF( ?awardDate > ?leibDate , "after" , "same" ) ) ) AS ?relation )
    }
  }
  OPTIONAL {
    ?award rdfs:label ?awardLabel .
    FILTER ( LANG( ?awardLabel ) = "en" )
  }
}
GROUP BY ?award ?awardLabel
ORDER BY DESC ( ?total )

