PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?person ?personLabel ?voice ?voiceLabel WHERE {
  ?person wdt:P31 wd:Q5 .
  ?person wdt:P412 ?voice .
  FILTER NOT EXISTS {
    ?person wdt:P106 ?occ .
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?voice rdfs:label ?voiceLabel FILTER ( LANG( ?voiceLabel ) = "en" )
  }
  FILTER ( regex( LCASE( STR( ?voiceLabel ) ) , "soprano|mezzo|contralto|countertenor|tenor|baritone|\\bbass\\b" ) )
}
LIMIT 1000

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
SELECT ?item ?itemLabel ?idescatCode ?population ?populationDate ?area ?coat WHERE {
  ?item wdt:P4335 ?idescatCode .
  FILTER ( STRSTARTS( STR( ?idescatCode ) , "25" ) ) .
  ?item wdt:P31 / wdt:P279 * wd:Q2074737 .
  ?item wdt:P131 + wd:Q5705 .
  OPTIONAL {
    ?item wdt:P2046 ?area .
  }
  OPTIONAL {
    ?item wdt:P94 ?coat .
  }
  {
    SELECT ?item ( SAMPLE( ?ppv_in ) AS ?popPrefVal ) ( MAX( ?ppt_in ) AS ?popPrefTime ) WHERE {
      ?item p:P1082 ?psPref .
      ?psPref wikibase:rank wikibase:PreferredRank .
      ?psPref ps:P1082 ?ppv_in .
      OPTIONAL {
        ?psPref pq:P585 ?ppt_in .
      }
    }
    GROUP BY ?item
  }
  OPTIONAL {
    SELECT ?item ( SAMPLE( ?pv_in ) AS ?popVal ) ( MAX( ?pt_in ) AS ?popTime ) WHERE {
      ?item p:P1082 ?ps .
      ?ps ps:P1082 ?pv_in .
      OPTIONAL {
        ?ps pq:P585 ?pt_in .
      }
      FILTER NOT EXISTS {
        ?item p:P1082 ?psPref2 .
        ?psPref2 wikibase:rank wikibase:PreferredRank .
      }
    }
    GROUP BY ?item
  }
  BIND( COALESCE ( ?popPrefVal , ?popVal ) AS ?population ) .
  BIND( COALESCE ( ?popPrefTime , ?popTime ) AS ?populationDate ) .
  OPTIONAL {
    ?item rdfs:label ?itemLabel FILTER ( LANG( ?itemLabel ) = "en" )
  }
}
ORDER BY ?itemLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?item ?label_en WHERE {
  ?item rdfs:label ?label_en .
  FILTER ( LANG( ?label_en ) = "en" && STR( ?label_en ) = "Madonna and Child" ) FILTER NOT EXISTS {
    ?item rdfs:label ?label_fr .
    FILTER ( LANG( ?label_fr ) = "fr" )
  }
}
LIMIT 500

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?system ?systemLabel ?branch ?branchLabel WHERE {
  VALUES ?gpls {
    wd:Q30268112
  }
  {
    ?system wdt:P749 ?gpls
  } UNION {
    ?system wdt:P361 ?gpls
  }
  OPTIONAL {
    ?system wdt:P527 ?branch .
  }
  OPTIONAL {
    ?system rdfs:label ?systemLabel .
    FILTER ( LANG( ?systemLabel ) = "en" )
  }
  OPTIONAL {
    ?branch rdfs:label ?branchLabel .
    FILTER ( LANG( ?branchLabel ) = "en" )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?country ?countryLabel ( COUNT( DISTINCT ?airport ) AS ?numAirports ) ?population WHERE {
  VALUES ?class {
    wd:Q6256 wd:Q3624078
  }
  ?country wdt:P31 ?class .
  OPTIONAL {
    ?airport wdt:P31 wd:Q1248784 ; wdt:P17 ?country .
    FILTER NOT EXISTS {
      ?airport wdt:P582 ?end .
    }
    FILTER NOT EXISTS {
      ?airport wdt:P576 ?diss .
    }
  }
  OPTIONAL {
    ?country wdt:P1082 ?population .
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" )
  }
}
GROUP BY ?country ?countryLabel ?population
ORDER BY DESC ( ?numAirports )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?item ?itemLabel ?prop ?propLabel WHERE {
  VALUES ?timeOrDuration {
    wd:Q11471 wd:Q2199864
  }
  {
    ?prop wikibase:propertyType wikibase:Time .
  } UNION {
    ?prop wdt:P1629 ?concept .
    ?concept ( wdt:P279 | wdt:P361 | wdt:P31 ) * ?timeOrDuration .
  }
  ?item wdt:P31 ?prop .
  OPTIONAL {
    ?item rdfs:label ?itemLabel FILTER ( LANG( ?itemLabel ) = "en" )
  }
  OPTIONAL {
    ?prop rdfs:label ?propLabel FILTER ( LANG( ?propLabel ) = "en" )
  }
}
ORDER BY ?itemLabel

PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
SELECT ?person ?start ?electoralDistrict ?election WHERE {
  ?person p:P39 ?pstmt .
  ?pstmt ps:P39 wd:Q29169698 .
  FILTER NOT EXISTS {
    ?pstmt pq:P582 ?end
  }
  .
  OPTIONAL {
    ?pstmt pq:P580 ?start
  }
  .
  OPTIONAL {
    ?pstmt pq:P768 ?electoralDistrict
  }
  .
  OPTIONAL {
    ?pstmt pq:P2715 ?election
  }
  .
}
