  ?item wdt:P17 wd:Q159 .
  ?item wdt:P31 ?type .
  ?item rdfs:label ?itemLabel .
  FILTER ( LANG( ?itemLabel ) = "en" ) .
  FILTER ( STRENDS( ?itemLabel , "pol" ) ) .
  OPTIONAL {
    ?item wdt:P625 ?coord
  }
  .
}
