PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ( COUNT( DISTINCT ?person ) AS ?count ) WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P21 wd:Q6581072 ; wdt:P19 wd:Q668 .
}

PREFIX schema: <http://schema.org/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?propEntity ?propLabel ( COUNT( DISTINCT ?item ) AS ?count ) ( ( COUNT( DISTINCT ?item ) * 100.0 ) / ?total AS ?percentage ) WHERE {
  {
    SELECT ( COUNT( DISTINCT ?item ) AS ?total ) WHERE {
      ?article schema:about ?item ; schema:inLanguage "ary" ; schema:isPartOf <https://ary.wikipedia.org/> .
      ?item wdt:P31 / wdt:P279 * wd:Q5398426 .
    }
  }
  ?article schema:about ?item ; schema:inLanguage "ary" ; schema:isPartOf <https://ary.wikipedia.org/> .
  ?item wdt:P31 / wdt:P279 * wd:Q5398426 .
  ?item ?p ?val .
  FILTER ( STRSTARTS( STR( ?p ) , "http://www.wikidata.org/prop/direct/" ) ) .
  BIND( IRI( REPLACE( STR( ?p ) , "http://www.wikidata.org/prop/direct/" , "http://www.wikidata.org/entity/" ) ) AS ?propEntity ) .
  FILTER NOT EXISTS {
    ?propEntity wikibase:propertyType wikibase:ExternalId .
  }
  OPTIONAL {
    ?propEntity rdfs:label ?propLabel .
    FILTER ( LANG( ?propLabel ) = "en" )
  }
}
GROUP BY ?propEntity ?propLabel ?total
ORDER BY DESC ( ?count )
LIMIT 20
